import React, { Component } from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";

class AddContact extends Component {
  render() {
    return (
      <div className="main">
        <h1>New Contact</h1>
      </div>
    );
  }
}

export default AddContact;
